import React from 'react';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Container from 'react-bootstrap/Container';
import { Button } from 'react-bootstrap';
export default function Header() {
	return (
		<header className=" d-flex flex-row justify-content-around text-white align-items-center w-100">
			<div
				className="w-25"
				style={{
					fontWeight: 700,
					fontSize: '2em',
				}}
			>
				SkyQuest
			</div>
			<nav className="d-flex flex-row justify-content-around w-50">
				<div>Home</div>
				<div>Flights</div>
				<div>Attractions</div>
				<div>Restaurants</div>
			</nav>
			<div>
				<div
					className="w-25"
					style={{
						borderWidth: 1,
						borderColor: 'white',
						borderRadius: 20,
					}}
				>
					Sign in
				</div>
			</div>
		</header>
	);
}
